import Link from 'next/link';
import styled from 'styled-components';

const ATag = styled.a`
    margin-right: 60px;
`;

const Header = () => (
    <div>
        <Link href="/">
            <ATag>Home</ATag>
        </Link>
        <Link href="/schedules">
            <ATag>Schedules</ATag>
        </Link>
        {/* <Link href="/today">
            <a style={linkStyle}>Today</a>
        </Link> */}
        <Link href="/about">
            <ATag>About</ATag>
        </Link>
    </div>
);

export default Header;
